      description: "\n<p>The <xref href=\"System.Collections.Generic.Dictionary`2\" data-throw-if-not-resolved=\"false\"></xref> whose keys are reflected in the new <xref href=\"System.Collections.Generic.Dictionary`2.KeyCollection\" data-throw-if-not-resolved=\"false\"></xref>.</p>\n"
